import '../styling/LandingPage.css';
import Typed from 'typed.js';
import { useEffect } from 'react';
import { useRef } from 'react';

const LandingPage = () => {

    const el = useRef(null);
    const typed = useRef(null);

    useEffect(() => {
        const options = {
            strings: [
            'Some <i>strings</i> are slanted',
            'Some <strong>strings</strong> are bold',
            'HTML characters &times; &copy;'
          ],
          typeSpeed: 50,
          backSpeed: 50,
        };

        // elRef refers to the <span> rendered below
        typed.current = new Typed(el.current, options);

        // return () => {
        //   // Make sure to destroy Typed instance during cleanup
        //   // to prevent memory leaks
        //   typed.current.destroy();
        // }
      }, [])



    return (
        <div>
            <div class="iam">
                <div class="helloworld">Hello world!</div><button class="button">Translate</button>
                <div className="type-wrap">
                    <h1> I am </h1> <h1><span style={{ whiteSpace: 'pre' }} ref={el} /></h1>
                </div>

                <a href="https://www.linkedin.com/in/tiffanylast" target="_blank"></a>
                <a href="https://github.com/tifflastimosa/Portfolio" target="_blank"></a>
                <a href="mailto:lastimosa.ti@northeastern.edu"></a>
            </div>
        </div>
    )

}

export default LandingPage;
